:root {
    --primary-background: #083c4a;
    --primary-foreground: #839496;
    --highlight-foreground: hsl(186, 8%, 68%);
}

html, iframe {
   background-color: var(--primary-background);
   color: var(--primary-foreground)
}

input, select, option {
   background-color: var(--primary-background);
   color: var(--primary-foreground)
}
a {
   background-color: inherit;
   color: var(--highlight-foreground);
   text-decoration: underline; 
   font-weight: bold;
}

a:visited {
   background-color: var(--primary-background);
   color: var(--highlight-foreground);
   text-decoration: underline; 
   font-weight: normal;
}

body {
    background: #222;
    color: #333;
    filter: invert(0.85);
}

img,
svg,
video {
    filter: invert(1.17); 
}
img[aria-hidden="true"] {
    filter:invert(0);
}

body {
    filter: invert(1);
}

ytd-app {
    filter: invert(0);
}

#player {
    filter: invert(1);
}

video {
    filter: invert(0);
}
